After patching   file : /usr/local/lib/python3.7/site-packages/markupsafe/__init__.py

        def format(*args, **kwargs): 
        to
        def format(self, *args, **kwargs):

It worked for me.

@mistercrunch 
I'm pretty sure the problem is because of query generation in Superset.
I'm also experiencing similar issue with druid returning internal server error.

Just to be sure: do we still want this new endpoint? Asking because the DateFilterControl widget and related code seems to have been updated quite often "recently".

If yes, I'd like to pick this up.

@mistercrunch

The more targeted fix would be on "/root/venv/lib/python3.6/site-packages/superset/connectors/druid/models.py", line 532, to go
```
    return Markup('<a href="{self.url}">{name}</a>').format(**locals())
    return Markup('<a href="{self.url}">{name}</a>'.format(**locals()))
```
